[{'comment_id': 1226058230, 'comment_body': 'A bit of cleanup needed here for formatting.', 'comment_created': datetime.datetime(2023, 6, 12, 3, 57, 56, tzinfo=datetime.timezone.utc), 'commenter': 'andyholmes', 'type': 'User'}, {'comment_id': 1226066685, 'comment_body': "This is great with the buttons being tied to the buffer. I was thinking the better way is to use the (undocumented) GActions, like `clipboard.copy`, but then I think those would be less obvious being in the UI file.

What do you think? If you think it's fine like this, let's go ahead and we can revisit later if necessary.", 'comment_created': datetime.datetime(2023, 6, 12, 4, 20, 22, tzinfo=datetime.timezone.utc), 'commenter': 'andyholmes', 'type': 'User'}, {'comment_id': 1226074789, 'comment_body': "Let's put this `ScrolledWindow` in a `Gtk.Frame`, then move `TextView {margin-bottom: 12; }` to `Frame { margin-bottom: 12; }`.

This boxes up the TextView nicely, and it makes it visible that the text continues below the viewport.", 'comment_created': datetime.datetime(2023, 6, 12, 4, 41, 6, tzinfo=datetime.timezone.utc), 'commenter': 'andyholmes', 'type': 'User'}, {'comment_id': 1226661952, 'comment_body': 'I think we can move with this one, Maybe we could comment the extra methods?
', 'comment_created': datetime.datetime(2023, 6, 12, 13, 23, 32, tzinfo=datetime.timezone.utc), 'commenter': 'SoNiC-HeRE', 'type': 'User'}, {'comment_id': 1228810072, 'comment_body': '```suggestion
      orientation: horizontal;
      margin-top: 12;
      margin-bottom: 12;
      halign: center;
      spacing: 18;
```', 'comment_created': datetime.datetime(2023, 6, 13, 23, 40, 58, tzinfo=datetime.timezone.utc), 'commenter': 'andyholmes', 'type': 'User'}, {'comment_id': 1228810311, 'comment_body': '```suggestion
      orientation: horizontal;
      halign: center;
      spacing: 18;
      margin-bottom: 18;
```', 'comment_created': datetime.datetime(2023, 6, 13, 23, 41, 34, tzinfo=datetime.timezone.utc), 'commenter': 'andyholmes', 'type': 'User'}, {'comment_id': 1228828688, 'comment_body': '```suggestion
      ScrolledWindow {
        height-request: 180;
        width-request: 600;

        TextView textview {
          bottom-margin: 12;
          left-margin: 12;
          right-margin: 12;
          top-margin: 12;
          editable: true;
          cursor-visible: true;
          wrap-mode: char;
        }
      }
    }
```', 'comment_created': datetime.datetime(2023, 6, 14, 0, 12, 49, tzinfo=datetime.timezone.utc), 'commenter': 'andyholmes', 'type': 'User'}, {'comment_id': 1228829283, 'comment_body': '```suggestion
      Button select {
        halign: center;
        label: _("Select all");
      }

      Button clear {
        halign: center;
        label: _("Clear all");
      }
```', 'comment_created': datetime.datetime(2023, 6, 14, 0, 14, 9, tzinfo=datetime.timezone.utc), 'commenter': 'andyholmes', 'type': 'User'}, {'comment_id': 1228832130, 'comment_body': 'Probably it would be best done with gi-docgen annotations (used to generate docs.gtk.org etc), because they can add extra things that aren't a part of GI. That's a longer fix, but I'm not sure GActions are guaranteed to be "API-stable", at least not until they're part of the documentation.

Maybe we can bring this up in #321, or a related demo.', 'comment_created': datetime.datetime(2023, 6, 14, 0, 21, 20, tzinfo=datetime.timezone.utc), 'commenter': 'andyholmes', 'type': 'User'}]

