[{'comment_id': 1263036284, 'comment_body': "One weird thing I forgot to mention, using `Gtk.ListBoxRow` doesn't work well with listmodel views. Instead we can just use a `Gtk.Box` with `Gtk.Label` inside.", 'comment_created': datetime.datetime(2023, 7, 13, 20, 42, 36, tzinfo=datetime.timezone.utc), 'commenter': 'andyholmes', 'type': 'User'}, {'comment_id': 1263040410, 'comment_body': "This is one of the confusing bits of these widgets. There are two properties of a `Gtk.ListItem`: `child` (the widget you make) and `item` which is the item from the `Gio.ListModel` (`Gtk.StringList` in our case).

So you want to do something like:

```js
const listRow = listItem.get_child();
const modelItem = listItem.get_item();

listRow.title = modelItem.string;
```

Of course, we'll be using a `Gtk.Box` with a `Gtk.Label` so it would be more like `listRow.child.label = modelItem.string;`, but you get the idea.", 'comment_created': datetime.datetime(2023, 7, 13, 20, 47, 34, tzinfo=datetime.timezone.utc), 'commenter': 'andyholmes', 'type': 'User'}, {'comment_id': 1263042903, 'comment_body': 'We should keep the original connection to the `Gtk.StringList`, but also have this one to make it obvious the model is inside the selection model.

More important here is to connect to `Gtk.SelectionModel::selection-changed`. I think just printing the title of the item(s) is fine for the callback.', 'comment_created': datetime.datetime(2023, 7, 13, 20, 50, 50, tzinfo=datetime.timezone.utc), 'commenter': 'andyholmes', 'type': 'User'}, {'comment_id': 1263043570, 'comment_body': 'Here we should get the current selection from the `Gtk.SelectionModel`.', 'comment_created': datetime.datetime(2023, 7, 13, 20, 51, 48, tzinfo=datetime.timezone.utc), 'commenter': 'andyholmes', 'type': 'User'}, {'comment_id': 1264243577, 'comment_body': 'We're going to use the same selection model and list model, but there's two ways to do that.

You can define the selection and list model here, then bind `Gtk.GridView:model` to `Gtk.ListView.model` (which will pull in the "child" list model). The other way is to define both selection/list models in code, then set the property from there.

As an exercise for you, think about which makes more sense in a real application and pick one of those. Ask yourself: would I need to swap list models (data source), swap selection models (none, single, multiple), or would I keep both the same and just add/remove items.

Think of this as just a practical exercise, not a right/wrong answer situation.', 'comment_created': datetime.datetime(2023, 7, 14, 23, 32, 45, tzinfo=datetime.timezone.utc), 'commenter': 'andyholmes', 'type': 'User'}, {'comment_id': 1264246470, 'comment_body': "We have a contribution style guide now, so be sure to check you're using the correct formatting. The style for [Child Widgets](https://github.com/sonnyp/Workbench/wiki/Contribution-Style-Guide#child-widgets) is like so:

```js
Parent {
  child: Box {
    property-name: value;
  };
}
```", 'comment_created': datetime.datetime(2023, 7, 14, 23, 43, 5, tzinfo=datetime.timezone.utc), 'commenter': 'andyholmes', 'type': 'User'}, {'comment_id': 1264247576, 'comment_body': '```suggestion
                    child: Adw.ActionRow {
                      title: bind template.item as <StringObject>.string;
```

I think this looks a little better.', 'comment_created': datetime.datetime(2023, 7, 14, 23, 44, 50, tzinfo=datetime.timezone.utc), 'commenter': 'andyholmes', 'type': 'User'}, {'comment_id': 1264248723, 'comment_body': "```suggestion
            Frame {
              valign: start;
```

The `GridView` you set up looks really nice with the frame, so let's do that here too.", 'comment_created': datetime.datetime(2023, 7, 14, 23, 49, 41, tzinfo=datetime.timezone.utc), 'commenter': 'andyholmes', 'type': 'User'}, {'comment_id': 1264249427, 'comment_body': "This `horizontal`, but for it's still stacking vertically. Have a look into [`max-columns`](https://docs.gtk.org/gtk4/property.GridView.max-columns.html) and [`min-columns`](https://docs.gtk.org/gtk4/property.GridView.min-columns.html), so we can get this laid out like the `Gtk.FlowBox` in the previous demo.", 'comment_created': datetime.datetime(2023, 7, 14, 23, 53, 20, tzinfo=datetime.timezone.utc), 'commenter': 'andyholmes', 'type': 'User'}, {'comment_id': 1264249815, 'comment_body': "We'll update these with some feedback from Sonny.", 'comment_created': datetime.datetime(2023, 7, 14, 23, 54, 58, tzinfo=datetime.timezone.utc), 'commenter': 'andyholmes', 'type': 'User'}, {'comment_id': 1264487335, 'comment_body': 'I created same model for populating both list and grid view in the code itself not in the UI', 'comment_created': datetime.datetime(2023, 7, 15, 16, 6, 30, tzinfo=datetime.timezone.utc), 'commenter': 'SoNiC-HeRE', 'type': 'User'}, {'comment_id': 1265681916, 'comment_body': "I'm sorry, I totally forgot my own advice here! I'm not sure why `Gtk.ListView` throws criticals when you use list box rows, but I told you to switch this to box & label and then said to switch it back :see_no_evil:

I guess something like this is pretty close to `Adw.ActionRow`:

```js
template ListItem {
  child: Gtk.Box {
    Gtk.Label {
      label: bind template.item as <StringObject>.string;
      height-request: 50;
      margin-start: 12;
      margin-end: 12;
    }
  };
};
```

What do you think?", 'comment_created': datetime.datetime(2023, 7, 17, 17, 26, 58, tzinfo=datetime.timezone.utc), 'commenter': 'andyholmes', 'type': 'User'}, {'comment_id': 1265685403, 'comment_body': "Sure, I think that'd be better, I'll update it", 'comment_created': datetime.datetime(2023, 7, 17, 17, 30, 35, tzinfo=datetime.timezone.utc), 'commenter': 'SoNiC-HeRE', 'type': 'User'}, {'comment_id': 1265689326, 'comment_body': 'So as per the meeting, let's just make this match the `main.json`.

