How about "List View Widgets" and "List and Grid views present a large dynamic list of model items"?', 'comment_created': datetime.datetime(2023, 7, 17, 17, 34, 54, tzinfo=datetime.timezone.utc), 'commenter': 'andyholmes', 'type': 'User'}, {'comment_id': 1265696835, 'comment_body': "I left a comment about this, but I'm interested in what you think as well.", 'comment_created': datetime.datetime(2023, 7, 17, 17, 42, 32, tzinfo=datetime.timezone.utc), 'commenter': 'andyholmes', 'type': 'User'}, {'comment_id': 1265712739, 'comment_body': 'Okay, this caught me off-guard, but it seems like we actually want this to be something like:

