        ColumnViewColumn col1 {
          title: _("Name");
          factory: SignalListItemFactory {};
        }
      }
```

I'd suggest we move as much as possible into the UI file. I think it's easier to glance at and understand, and it's also language-agnostic, so GJS/Python/Vala programmers can use the same source example.

We also want to be sure to set the `title` for each column, at least those that aren't something like an icon. I'd suggest the file name column be set to `expand: true;`, but I'm not sure about the others.

When we get a little deeper into this demo, we might want to use a `Gtk.BuilderListItemFactory`, but let's start with this.', 'comment_created': datetime.datetime(2023, 7, 22, 21, 7, 37, tzinfo=datetime.timezone.utc), 'commenter': 'andyholmes', 'type': 'User'}, {'comment_id': 1271354752, 'comment_body': "Let's use `Gio.FileInfo.get_display_name()`, which may use a more human-readable name and then fallback to the standard `name` if necessary.", 'comment_created': datetime.datetime(2023, 7, 22, 22, 25, 53, tzinfo=datetime.timezone.utc), 'commenter': 'andyholmes', 'type': 'User'}, {'comment_id': 1271354823, 'comment_body': '```suggestion
