Frames are pretty.', 'comment_created': datetime.datetime(2023, 8, 3, 21, 22, 45, tzinfo=datetime.timezone.utc), 'commenter': 'andyholmes', 'type': 'User'}, {'comment_id': 1285135922, 'comment_body': 'Cool, now that you've got a handle on this, let's break this into separate variables so it's *really* clear what's going on. This is one of the tougher things for people to grasp.

I would do something like:

```js
const data_model = new Gtk.DirectoryList({ ... });

const sort_model = new Gtk.SortListModel({ ... });

column_view.model = new Gtk.SingleSelection({ ... });
```

This way those reading the code don't have to unravel the nesting "backwards", and its really obvious what's being done.', 'comment_created': datetime.datetime(2023, 8, 6, 0, 8, tzinfo=datetime.timezone.utc), 'commenter': 'andyholmes', 'type': 'User'}, {'comment_id': 1285136071, 'comment_body': 'Let's remove all the function wrappers on these, and add comments like:

