Here is what I'd imagine that looking like:

[Screencast from 2023-08-05 16-52-36.webm](https://github.com/sonnyp/Workbench/assets/1265208/b6e910d8-d40a-48fb-a487-52cc932adbbd)
', 'comment_created': datetime.datetime(2023, 8, 5, 23, 54, 49, tzinfo=datetime.timezone.utc), 'commenter': 'andyholmes', 'type': 'User'}, {'comment_id': 1285135455, 'comment_body': 'Sorry, I missed this in the review. This is a `Promise`, and you're not actually passing the resulting file to the launcher. Something like this makes more sense here:

```js
  let new_file = null;

  const dialog_for_file = new Gtk.FileDialog({
    title: _("Select File"),
    modal: true,
  });
  dialog_for_file
    .open(workbench.window, null)
    .then((result) => {
      new_file = result;
    })
    .catch((err) => {
      console.debug(err.message);
    })
    .finally(() => {
      file_launcher.set_file(new_file);
    });
```', 'comment_created': datetime.datetime(2023, 8, 5, 23, 57, 51, tzinfo=datetime.timezone.utc), 'commenter': 'andyholmes', 'type': 'User'}]

